import React from 'react';
import './App.css';
import GithubLogo from "/Users/bryan/Desktop/reactWebApp/my-app/src/media/github logo.png";
import LinkedInLogo from "/Users/bryan/Desktop/reactWebApp/my-app/src/media/linkedIn logo.png";


let answer = 0;

interface LinkedInProps {
  hasLinkedIn: boolean,
  linkedInLink: string
}

interface GithubProps {
  hasGithub: boolean,
  githubLink: string
}

interface DisplayProps {
  name: string,
  hasLinkedIn: boolean,
  hasGithub: boolean,
  linkedInLink: string,
  githubLink: string
}

let encodeAnswer = () => {
  answer *= 83;
}

let decodeAnswer = () => {
  answer /= 83;
}


class DevInfo {
  name: string;
  hasLinkedIn: boolean;
  hasGithub: boolean;
  linkedInLink: string;
  githubLink: string;

  constructor(name: string, hasLinkedIn: boolean, hasGithub: boolean, linkedInLink: string, githubLink: string){
    this.name = name;
    this.hasLinkedIn = hasLinkedIn;
    this.hasGithub = hasGithub;
    this.linkedInLink = linkedInLink;
    this.githubLink = githubLink;
  } 
}

const GithubPreview = ({hasGithub, githubLink}: GithubProps ) => {
  if (hasGithub) {
    return (
      <div>
        <a href={githubLink}><img className="github" src={GithubLogo} alt="Github" /></a>
      </div>
    )
  }
  else {
    return <div></div>;
  }
}

const LinkedInPreview = ({hasLinkedIn, linkedInLink}: LinkedInProps) => {
  if (hasLinkedIn) {
    return (
      <div>
        <a href={linkedInLink}><img className="linkedin" src={LinkedInLogo} alt="linkedIn" /></a>
      </div>
    )
  }
  else {
    return <div></div>;
  }
}

const DisplayInfo = ({ name, hasLinkedIn, hasGithub, linkedInLink, githubLink }: DisplayProps) => {
  return (
    <div>
      <h3>{ name }</h3>
      <div className="links">
        <LinkedInPreview hasLinkedIn={(hasLinkedIn)} linkedInLink={linkedInLink} />
        <GithubPreview hasGithub={hasGithub} githubLink={githubLink} />
      </div>
    </div>
  );
}

const NavBar = () => {

  return (
    <nav>
      <div>Easy</div>
      <div>Medium</div>
      <div>Hard</div>
    </nav>
  )
}

// let bryan = new DevInfo("Bryan",true ,true,"https://linkedin.com/in/bryang229","https://github.com/bryang229");

const decodeOperand = (operand : number) : string => {
  if(operand == 1)
    return "+";
  else if(operand == 2)
    return "-";
  else if(operand == 3)
    return "*";
  return "Operand Error? ";

}

const getSum = (a: number, b: number, operand: number) : number => {
  if(operand == 1)
    return a + b;
  else if(operand == 2)
    return a - b;
  else if(operand == 3)
    return a * b;
    return -1;

}

const easyMode = () =>{
  let a = Math.floor(Math.random()*50)-25;
  let b = Math.floor(Math.random()*50)-25;
  let operand = Math.floor(Math.random()*3);

  answer = getSum(a,b,operand);


}


function App() {
  return (
    <div>
      <h1>Chose your difficulity</h1>
      <br />
      <div className="App">
        <NavBar />
      </div>
      <footer>
        <h3>ЯO|OR</h3>
        <div id="about">
          <DisplayInfo name={"Bryan"} hasGithub={true} hasLinkedIn={true} linkedInLink={"https://linkedin.com/in/bryang229"} githubLink={"https://github.com/bryang229"}/>
          <DisplayInfo name={"Isaiah"} hasGithub={true} hasLinkedIn={false} linkedInLink={""} githubLink={"https://github.com/IsaiahMar"}/>
          <DisplayInfo name={"David"} hasGithub={true} hasLinkedIn={false} linkedInLink={""} githubLink={"https://github.com/David800888"}/>
          <DisplayInfo name={"Josiah"} hasGithub={false} hasLinkedIn={false} linkedInLink={""} githubLink={""}/>
          </div>
      </footer>
    </div>
  );
}

export default App;
